import React, { useEffect, useState } from 'react';
import Navbar from '../../components/navbar/NavbarFreelancer';
import axios from 'axios';

const ProfileFreelancer = () => {
  const [profileData, setProfileData] = useState({});
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchProfileData = async () => {
      try {
        const { data } = await axios.get(
          "http://localhost:8001/profile",
          { withCredentials: true }
        );

        const { success, profile } = data;
        if (success) {
          setProfileData(profile);
        } else {
          setError("Failed to fetch profile data");
        }
      } catch (error) {
        setError("Failed to fetch profile data");
        console.log(error);
      }
    };

    fetchProfileData();
  }, []);

  return (
       <>
      <Navbar />
      <div className="container">
        <h2>Profile</h2>
        {error && <p className="error-message">{error}</p>}
        {profileData && (
          <div className="profile-section">
            <img
              src={profileData.profilePhoto}
              alt="Profile"
              className="profile-photo"
            />
            <div className="profile-details">
              <p>Name: {profileData.userName}</p>
              <p>Email: {profileData.email}</p>
              {/* Add similar structure for other profile details */}
            </div>
          </div>
        )}
      </div>
    </>
  );
};

export default ProfileFreelancer;
